import React from "react";
import './App.css';

export default function App() {
  return <div className="App"><h1>Weather app</h1>
    <footer><span>This project was coded by Isabel Klint and is </span>
      <a href="https://github.com/isabelklint/react-weather-app" target="_blank">open sourced on Github.</a>
      </footer>
    </div>;
}
